import React from "react";
import "./css-components/App.css";
import Login from "./login";

function App() {
  const userLogin = (token) => {
    console.log(token);
    if (token) {
      alert("Logged in!");
    } else {
      alert("Error in logging in ");
    }
  };

  return (
    <div className="App">
      <Login userlogin={userLogin} />
    </div>
  );
}

export default App;
